//import from './logo.svg';
import React from "react";
import './App.css';
import Header from './Header';
import Home from './Home';
import {  BrowserRouter as Router,  Routes,  Route} from "react-router-dom"

import Checkout from './Checkout';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/checkout">
          <Header />
          <Checkout />
        </Route>
        <Route path="/">
          <Header />
          <Home />
        </Route>
      </Routes>
    </div>
  )
}

export default App;
